import React, { useState } from 'react';
import { redirect } from "react-router-dom";

export default function Test() {

    const onSubmit = (e) => {
        e.preventDefault();
        return redirect("/profile");

    }
    return (
        <div>
            <h1>Test</h1>
            <form onSubmit={onSubmit}>
            <input type="submit" name="submit" value="submit" />
            </form>
        </div>
    );
}
